import Foundation

/**
 Card Logo Type enum
 
 - Visa:       Visa card logo
 - MasterCard: MasterCard card logo
 - AMEX:       AMEX card logo
 - Maestro:    Maestro card logo
 - CID:        CID logo
 - CVC:        CVC logo
 - Unknown:    Unknown placeholder logo
 */
public enum CardLogoType {
    /// Visa card logo
    case visa
    /// MasterCard card logo
    case masterCard
    /// AMEX card logo
    case amex
    /// Maestro card logo
    case maestro
    /// CID logo
    case cid
    /// CVC logo
    case cvc
    /// Unknown placeholder logo
    case unknown
}


/// The CardLogoView that shows a given card logo on a view
open class CardLogoView: UIView {
    /// Set a type for the current CardLogoView
    open var type: CardLogoType = .unknown
    
    
    /**
     Designated initializer for creating a logo connected to cards
     
     - parameter type: CardLogoType
     
     - returns: a CardLogoView object
     */
    public required init(type: CardLogoType = .unknown) {
        self.type = type
        super.init(frame: CGRect.zero)
    }
    
    
    /**
     Required initializer for creating a logo connected to cards
     
     - parameter aDecoder: the decoder
     
     - returns: a deserialized CardLogoView
     */
    public required init?(coder aDecoder: NSCoder) {
        super.init(coder: aDecoder)
    }
    
    
    /**
     Override function that draws the content of the CardLogoView
     
     - parameter rect: the CGRect to draw in
     */
    open override func draw(_ rect: CGRect) {
        switch self.type {
        case .visa:
            drawIc_card_visaCanvas()
        case .masterCard:
            drawIc_card_mastercardCanvas()
        case .amex:
            drawIc_card_amexCanvas()
        case .maestro:
            drawIc_card_maestroCanvas()
        case .cid:
            drawIc_card_cidvCanvas()
        case .cvc:
            drawIc_card_cvcCanvas()
        default:
            drawIc_card_unknownCanvas()
        }
    }
    
}
